import React from 'react';
import cls from './MyPosts.module.css';
import Post from './Post/Post.jsx';

const MyPosts = () => {

    return (
        <div>

            <div className={cls.posts}>
                <Post message='Hi everybody!' />
                <Post message='I created new akk' />
                <Post message='This is my firs project on React!!!'/>
                <Post message='great mood :)'/>
            </div>

        </div>
    );
};

export default MyPosts;
